    false,nt"url": null,nt"notes": "Depicts the Imagine Austin Comprehensive
    Plan Growth Concept Corridors.  See http://www.austintexas.gov/department/planning
    for more information. The Growth Concept Map assembles compact and walkable activity
    centers and corridors, as well as job centers, and coordinates them with future
    transportation improvements. These centers and corridors allow people to reside,
    work, shop, access services, people watch, recreate, and hang out without traveling
    far distances. Within them, the design and scale of buildings and the design and
    availability of parks and gathering spaces will welcome people of all ages and abilities.
    They will be walkable, bikable, and connected to one another, the rest of the city,
    and the region by roads, transit, bicycle routes and lanes, and trails. The activity
    centers and corridors included on this map identify locations for additional people
    and jobs above what currently exists on the ground. Unlike more detailed small-area
    plan maps, the Growth Concept Map provides broad direction for future growth and
    is not parcel specific. Centers that are already established by existing small-area
    plans, such as those for East Riverside Drive or Highland Mall, are drawn to reflect
    those plans. Centers without small-area plans are simply shown with a circle, indicating
    scale and general location. Specifying boundaries for these centers may occur through
    small-area plans or general guidelines for implementing this plan. This product
    is for informational purposes and may not have been prepared for or be suitable
    for legal, engineering, or surveying purposes. It does not represent an on-the-ground
    survey and represents only the approximate relative location of property boundaries.
    This product has been produced by the Planning and Development Review Department
    for the sole purpose of geographic reference. No warranty is made by the City of
    Austin regarding specific accuracy or completeness.",nt"license_title": "License
